<template>
  <div>
      <FormEmployee ref="FormEmployee"></FormEmployee>
      <ListaEmployee v-bind:empregados="empregados"></ListaEmployee>
  </div>
</template>

<script>
import FormEmployee from './FormEmployee';
import ListaEmployee from './ListaEmployee';
import Employee from '../../models/Employee';
export default {
  data() {
    return {
      contador: 6,
      empregados: [
        new Employee(1, "BB-8", 6900, 5, "data:image/jpeg;base64,"),
        new Employee(2, "R2-D2", 9200, 22, "data:image/jpeg;base64,"),
        new Employee(3, "Chewie", 5120, 34, "data:image/jpeg;base64,"),
        new Employee(4, "Han Solo", 87510, 45, "data:image/jpeg;base64,"),
        new Employee(5, "Amidala", 54500, 33, "data:image/jpeg;base64,")
      ]
    };
  },
methods: {
  salvar(employee){
    if(employee.id){
      const index = this.empregados.findIndex(x => x.id == employee.id);
      const empregados = [...this.empregados];
      empregados[index] = employee;
      this.empregados = empregados
    }else{
    employee.id = this.contador;
    this.contador = this.contador + 1;
    this.empregados.push(employee)
  }
  },
  excluir(id){
    const index = this.empregados.findIndex(x => x.id == id);
    this.empregados.splice(index, 1);
  },
  editar(employee){
    this.$refs.FormEmployee.carregar(employee);
  }
},

components: {
    FormEmployee,
    ListaEmployee
}
}
</script>

